    <script>
        var arr = [1, 1, 2, 3, 'a', 2, 5, 7, 9, 'a', 5, 6];
        Array.prototype.qc = function() {
            var length = this.length;
            var newArr = [];
            var obj = {};
            for (var i = 0; i < length; i++) {
                if (!obj[this[i]]) {
                    obj[this[i]] = "abc";

        }
